	if (parts.length > max_idx) {

		if (id_idx_int == -1) {
			id = String.valueOf(count);
		}
		else {
			id = parts[id_idx_int];
		}

		String point = "<Point Id=\"" + id +"\" " +
                        "X=\"" + parts[long_idx_int] + "\" " +
                        "Y=\"" + parts[lat_idx_int] + "\"/>\n";

		if ((count % 10) == 0) {

			testing_builder.append(point);
		} else {

			creation_builder.append(point);
		}		
	}
}
